  const arr = [];
  for (let i = 0; i < len; i++) {
    arr.push(i);
  }
  return arr;
};

const newTransfer = () => {
  return {
    reference: "Rida",
    executionDate: "KHOUNA",
    principalAccount: 1111111111,
    beneficiaryAccount: 222222222,
    totalAmount: 2000,
    stateAction: <>
      <Button className="btn-icon btn-simple" style={{border:0}} color="primary" size="sm">
        <i className="fa fa-check"></i>
      </Button>{` `}
      <Button className="btn-icon btn-simple" style={{border:0}} color="primary" size="sm">
        <i className="fa fa-times" />
      </Button>{` `}
      <Button className="btn-icon btn-simple" style={{border:0}} color="primary" size="sm">
        <i className="fa fa-eye"></i>
      </Button>
    </>
  };
};

export function makeData(len = 5553) {
  return range(len).map(d => {
    return {
      ...newTransfer(),
      children: range(10).map(newPerson)
    };
  });
}
